import react, { Fragment } from 'react'

const NavBar = () => {

    return(
        <React.Fragment>

                <ul>
                    <li>Home</li>
                    <li>Producto</li>
                    <li>Ubicacion</li>
                    <li>Contacto</li>
                </ul>

        </React.Fragment>
    )
}

export default NavBar;
